import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on a category card to navigate to a page with sort options
    // Using a text-based selector for the link within the card
    await page.waitForSelector('a:has-text("Shop electronics")', { timeout: 5000 });
    await page.getByText('Shop electronics').first().click();

    // Wait for the sort dropdown to be visible on the results page
    await page.waitForSelector('#sortSelect', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_results_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_results_page.png'));

    // Select the "Price: Low to High" option from the sort dropdown
    const sortValue = 'price-low';
    await page.selectOption('#sortSelect', sortValue);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_sorted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_sorted.png'));

    // Extract the selected value to confirm the action
    const selectedSort = await page.locator('#sortSelect').inputValue();

    if (selectedSort !== sortValue) {
      throw new Error(`Sort filter was not applied correctly. Expected ${sortValue}, but got ${selectedSort}.`);
    }

    return {
      success: true,
      action: "Applied 'Price: Low to High' sort filter.",
      extractedData: {
        appliedSort: selectedSort
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price sort filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
